(34, 'Apple Earphones High Quality for iPhone 5 OEM', 'AEH-0001', 'apple-earphones-high-quality-for-iphone-5-oem', 9, 22, 1, 35000, 'irphone.png', '100', '<p>Earphones High Quality for iPhone 5 Kompatibel dengan semua Apple iPod dan pemutar digital. Earphone dirancang untuk kenyamanan. Aksesori yang universal ini memiliki desain ramping dan memberikan kualitas suara dan bass yang jernih.</p>', '<p>Earphones High Quality for iPhone 5 Kompatibel dengan semua Apple iPod dan pemutar digital. Earphone dirancang untuk kenyamanan. Aksesori yang universal ini memiliki desain ramping dan memberikan kualitas suara dan bass yang jernih, apakah Anda sedang mendengarkan lagu favorit Anda saat bekerja di meja Anda, berjalan di atas treadmill, atau bersantai di rumah. Kompak dan ultra-portabel, earphone ini cocok dengan mudah dalam saku atau tas sehingga Anda dapat mengambil mereka dan pergi.</p>', 0, 1, 1, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(35, 'Apple iPod Earphones (OEM)', 'AEH-0002', 'apple-ipod-earphones-oem', 9, 22, 1, 36000, 'apple-ipod-1.png', '100', '<p>Earphones Untuk Ipod Kompatibel dengan semua Apple iPod dan pemutar digital. Earphone dirancang untuk kenyamanan. Aksesori yang universal ini memiliki desain ramping dan memberikan kualitas suara dan bass yang jernih.</p>', '<p>Earphones Untuk Ipod&nbsp;Kompatibel dengan semua Apple iPod dan pemutar digital. Earphone dirancang untuk kenyamanan. Aksesori yang universal ini memiliki desain ramping dan memberikan kualitas suara dan bass yang jernih, apakah Anda sedang mendengarkan lagu favorit Anda saat bekerja di meja Anda, berjalan di atas treadmill, atau bersantai di rumah. Kompak dan ultra-portabel, earphone ini cocok dengan mudah dalam saku atau tas sehingga Anda dapat mengambil mereka dan pergi.</p>', 0, 1, 1, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(36, 'KexTech USB Wireless Adapter 150Mbps', 'WRK-0001', 'kextech-usb-wireless-adapter-150mbps', 16, 1, 1, 57000, 'ketek-001.gif', '200', '<p>Produk ini merupakan USB Wireless Adapter yang mendukung koneksg/n. Walaupun adaptor ini kecil, namun perangkat sudah mampu mendukung WiFi 802.11n dengan speed maximal 150mb/s, 3 kali lebih cepat daripada koneksi 802.11g.</p>', '<p><strong>Features</strong><br /> <br /> Mendukung WiFi 802.11n<br /> WiFi 802.11n merupakan koneksi wireless dengan kecepatan dan jangkuan yang maximal. Kecepatan maximal hingga 150mb/s.<br /> <br /> Design Portable<br /> Bentuk yang sangat kecil membuat USB Wireless Adapter ini dapat di bawa kemana-mana.<br /> <br /> Plug and Play<br /> Tidak perlu menginstal driver dari cd untuk menjalankan prangkat ini. Cukup mencolokkan USB Wireless Adapater ini ke Laptop atau PC Anda dan device ini akan otomatis melakukan instaling.<br /> <br /> Kompatible<br /> Dapat digunakan untuk semua Laptop dan PC yang memiliki USB Port dan OS Windows2000/XP/2003/Vista/win7, MAC OS,Linux</p>', 0, 1, 1, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(37, 'Pigtail Modem Huawei E5372-S SLIM, MAX - ZTE MF825A Dual Channel FME Male', 'PMM-0001', 'pigtail-modem-huawei-e5372-s-slim-max-zte-mf825a-dual-channel-fme-male', 17, 21, 1, 93000, 'pigtail-1.png', '100', '<p>Support dan cocok untuk tipe-tipe modem 4G LTE yang memiliki PORT ANTENA 2 (dua) buah, yang memiliki dual POLARISASI Vertikal dan Horizontal dengan teknologi MIMO (Multi In Multi Out) terutama Huawei SLIM , MAX dan ZTE MF825A yang mempunyai dua slot antena.</p>', '<div class="blog-content-entry" style="text-align: justify;">\r\n<p>Support dan cocok untuk tipe-tipe modem 4G LTE yang memiliki PORT ANTENA 2 (dua) buah, yang memiliki dual POLARISASI Vertikal dan Horizontal dengan teknologi MIMO (Multi In Multi Out)</p>\r\n<p><strong>Spesifikasi :</strong></p>\r\n<ul style="list-style-type: undefined;">\r\n<li>Pigtail Adapter Tipe PLUG-IN (Colok) Cabang dua / Dual Port</li>\r\n<li>Impedance: 50 ohm</li>\r\n<li>Pigtail tidak longgar (tidak mudah lepas)</li>\r\n<li>Tipe Konektor: FME Male</li>\r\n<li>Tipe Kabel: RG174</li>\r\n<li>Finishing : Pabrikasi (bukan handmade)</li>\r\n</ul>\r\n</div>', 0, 1, 1, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(38, 'FlashDisk Kingston DataTraveler 100 16GB USB 3.0', 'FDK-0001', 'flashdisk-kingston-datatraveler-100-16gb-usb-30', 22, 12, 1, 111000, '28937_2.jpg', '108000', '<p>Kingston DataTraveler&reg; 100 G3 (DT100G3) USB Flash drive kompatibel dengan generasi USB 3.0 spesifikasi untuk mengambil keuntungan dari teknologi dalam notebook baru, PC desktop dan perangkat digital.</p>', '<p>Kingston DataTraveler&reg; 100 G3 (DT100G3) USB Flash drive kompatibel dengan generasi USB 3.0 spesifikasi untuk mengambil keuntungan dari teknologi dalam notebook baru, PC desktop dan perangkat digital. Dengan DT100G3, menyimpan dan mentransfer dokumen, presentasi, musik, video, dan banyak lagi lebih cepat dan lebih mudah dari sebelumnya.<br /><br />DT100G3 memiliki ramping, desain hemat biaya untuk membuat transisi memuaskan ke USB 3.0 pengalaman investasi minimal. Tersedia dalam kapasitas 8GB dari-64GB, DT100G3 kompatibel dengan USB 2.0 dan memiliki garansi lima tahun. Masa depan-bukti penyimpanan portabel Anda sekarang</p>', 0, 1, 1, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(39, 'Kingston DataTraveler Generation 4 16GB USB 3.0', 'FDK-0002', 'kingston-datatraveler-generation-4-16gb-usb-30', 22, 1, 1, 108400, 'kingston-datatraveler-generation-4-dtig4-16gb-blue-1.jpg', '200', '<p>Kingston DataTraveler&reg; G3USB Flash drive kompatibel dengan generasi USB 3.0 spesifikasi untuk mengambil keuntungan dari teknologi dalam notebook baru, PC desktop dan perangkat digital.</p>', '<p>Kingston DataTraveler&reg; G3USB Flash drive kompatibel dengan generasi USB 3.0 spesifikasi untuk mengambil keuntungan dari teknologi dalam notebook baru, PC desktop dan perangkat digital.memiliki ramping, desain hemat biaya untuk membuat transisi memuaskan ke USB 3.0 pengalaman investasi minimal.</p>', 0, 1, 0, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(40, 'Kingston DataTraveler Generation 4 8GB USB 3.0', 'FDK-003', 'kingston-datatraveler-generation-4-8gb-usb-30', 22, 1, 1, 78700, 'kingston-datatraveler-generation-4-dtig4-8gb-yellow-2.jpg', '200', '<p>Kingston DataTraveler&reg; G3USB Flash drive kompatibel dengan generasi USB 3.0 spesifikasi untuk mengambil keuntungan dari teknologi dalam notebook baru, PC desktop dan perangkat digital.</p>', '<p>Kingston DataTraveler&reg; G3USB Flash drive kompatibel dengan generasi USB 3.0 spesifikasi untuk mengambil keuntungan dari teknologi dalam notebook baru, PC desktop dan perangkat digital.memiliki ramping, desain hemat biaya untuk membuat transisi memuaskan ke USB 3.0 pengalaman investasi minimal.</p>', 0, 1, 1, 1, 2, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(41, 'Logitech B100 Optical Mouse', 'LGM-0001', 'logitech-b100-optical-mouse', 26, 24, 1, 49000, 'logitech-b100-optical-mouse-hitam-7391-78953-1-product.jpg', '250', '<p><span class="firstnav" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px;">Logitech B100 Optical Mouse adalah mouse dengan desain ambidextrous yang nyaman dengan desain yang sederhana yang membuat Anda menikmati pekerjaan Anda dengan nyaman ketika dipakai untuk bekerja dalam waktu yang lama. Mouse keluaran Logitech ini dilengkapi sensor optik menghasilkan gerakan kursor lebih halus dan dengan akurasi serta sensitivitas yang tinggi.</span></p>', '<p>Logitech B100 Optical Mouse adalah mouse dengan desain ambidextrous yang nyaman dengan desain yang sederhana yang membuat Anda menikmati pekerjaan Anda dengan nyaman ketika dipakai untuk bekerja dalam waktu yang lama.</p>\r\n<p><span class="firstnav" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px;">Mouse keluaran Logitech ini dilengkapi sensor optik menghasilkan gerakan kursor lebih halus dan dengan akurasi serta sensitivitas yang tinggi.</span><br /> <br /> <strong>Navigasi presisi</strong><br /> Optik dengan 800 dpi membuat kontrol kursor yang halus dan presisi membantu Anda dalam menavigasi web maupun mengatur dokumen dengan tepat dan terasa nyaman.<br /> <br /> <strong>Pengoprasian Sederhana</strong><br /> Tanpa menginstall apapun Anda dapat langsung mencolok pada port usb dan mulai menggunakan mouse ini dan Anda pun siap untuk menjalani hari Anda dengan mouse yang nyaman.<br /> <br /> <strong>Kualitas Logitech</strong><br /> Mouse ini dirancang oleh Logitech dengan kualitas yang telah terbukti dari milyaran mouse yang telah diproduksi oleh Logitech <br /> <br /> <strong>Kebebasan Pemakaian</strong><br /> Mouse ini dikoneksikan oleh USB dan kompatibel dengan OS: Windows&Atilde;&sbquo;&Acirc;&reg; XP, Windows Vista&Atilde;&sbquo;&Acirc;&reg; or Windows&Atilde;&sbquo;&Acirc;&reg; 7, Linux&Atilde;&sbquo;&Acirc;&reg; kernel 2.4+</p>', 0, 1, 1, 1, 4, NULL, 0, 0, 0, NULL, 1, NULL, NULL, NULL),
(42, 'Logitech Wireless Mouse M165', 'LGM-0002', 'logitech-wireless-mouse-m165', 26, 24, 1, 78000, 'mouse-optico-m165-logitech-inalambrico-usb-1000dpi-negro-15300-MLM20098389199_052014-F.jpg', '250', '<p>Mouse ini mengandalkan frekuensi 2.4 GHz agar dapat bekerja nirkabel dengan lebih lancar. Desain ergonomis pada seluruh body mouse dapat meningkatkan kenyamanan Anda selama beraksi pada Notebook atau Desktop. LOGITECH M165 dapat mengkonsumsi tenaga baterai secara efisien sehingga dapat menghemat energi baterai hingga 12 bulan.</p>', '<p>Kini Anda dapat merasakan kenyamanan dan kemudahan dalam bekerja atau browsing internet pada PC Anda dengan Mouse Wireless LOGITECH M165. Mouse ini mengandalkan frekuensi 2.4 GHz agar dapat bekerja nirkabel dengan lebih lancar. Desain ergonomis pada seluruh body mouse dapat meningkatkan kenyamanan Anda selama beraksi pada Notebook atau Desktop. LOGITECH M165 dapat mengkonsumsi tenaga baterai secara efisien sehingga dapat menghemat energi baterai hingga 12 bulan. LOGITECH menyediakan Nano Receiver berukuran mini yang dapat Anda hubungkan dengan port USB pada device PC Anda. Tidak perlu instalasi perangkat lunak tambahan, LOGITECH M165 dapat langsung bekerja setiap saat Anda butuhkan.</p>\r\n<p>Mouse Wireless LOGITECH M165 dapat bekerja secara nirkabel dengan mengandalkan koneksi 2.4 GHz. Teknologi Logitech Advanced 2.4 GHz memungkinkan Mouse dapat bekerja secara terus menerus berkat koneksi dahsyat yang dapat diandalkan tanpa jeda atau terputus-putus. Untuk dapat bekerja secara nirkabel, LOGITECH menambahkan sebuah Nano Receiver kecil yang berfungsi sebagai penangkap sinyal dari Mouse agar diteruskan ke perangkat PC. Penggunaan Mouse ini sama mudahnya dengan mouse berkabel. Anda hanya perlu memasukan Nano Receiver pada port USB dan Mouse dapat langsung digunakan tanpa instalasi tambahan yang merepotkan. Ukuran Nano Receiver sangat kecil sehingga Anda dapat membiarkannya tertancap pada port USB Notebook ketika berpergian agar tidak mudah hilang atau rusak.</p>\r\n<p>LOGITECH M165 dibekali teknologi sensor optik berdefinisi tinggi yang dapat bekerja secara akurat dan handal pada berbagai jenis permukaan. Dengan sensor 1000-dpi yang dimilikinya, Mouse ini dapat mengontrol kursor dengan lebih mulus dan responsif. LOGITECH M165 dapat digunakan pada perangkat PC Desktop atau Notebook yang bekerja dengan sistem operasi Windows 8/7/Vista dan Mac OS X atau versi terbaru di atasnya. Berkat teknologi terkini yang ditanamkan pada LOGITECH M165 membuatnya dapat bekerja secara efisien dalam konsumsi daya baterai. Wireless Mouse ini dapat menghemat daya baterai sehingga dapat bertahan hingga 12 bulan lamanya*.&nbsp; Anda dapat menggunakan baterai berjenis AAA untuk mengoperasikan Mouse ini. sebuah tombol knop ON/OFF telah disediakan untuk membantu Anda menghemat baterai.</p>', 0, 1, 1, 1, 4, NULL, 5, 0, 0, NULL, 1, NULL, NULL, NULL),
